import React, { Component } from 'react';
import {Menu, Container, Button, Header} from 'semantic-ui-react';
import {Link} from 'react-router-dom';
class Navbar extends Component {
    state = {authenticated : false};
    handleSignIn = () => {
        this.setState({authenticated : true});
    }
    handleSignOut = () => {
        this.setState({authenticated : false});
        this.props.history.push('/')
    }
    render() {
        return (
            <Menu style = {{background : "#E2229C" , height : "80px"}}>
                <Container>
                    <Menu.Item position = "left" as = {Link} to = "/">
                        <Header as = "h1" style = {{color: "white"}}>Hobby Lobby</Header>
                    </Menu.Item>
                    <Menu.Item>
                        <Button primary as = {Link} to = "/login">Login</Button>
                        <Button primary as = {Link} to = "/signup" content = "Sign Up" style = {{marginLeft : '0.5px'}}/>
                    </Menu.Item>
                </Container>
            </Menu>
        );
    }
}

export default Navbar;
